    function IsUnique(str) {
        return new Set(str).size == str.length;
    }

    function GetFirstWord() {
        var word = "";
        var alright = [];
        for (i = 0; i < VALID_GUESSES.length; i++)
            if (IsUnique(VALID_GUESSES[i]))
                alright.push(VALID_GUESSES[i]);

        var returnValue = alright[Math.floor(Math.random() * alright.length)];

        return returnValue;
    }

    function AddWordToStream(word) {
        document.getElementById("stream").innerHTML += '<div class="word">' + word + '</div>';
    }

    window.onload = function () {
        AddWordToStream(GetFirstWord());
    };

    function GetWildcards() {
        var retVal = ["","","","",""]
        var numQ = 0;
        var locked = [];
        for (i = 0; i < results.length; i++) {
            currentWord = results[i];
            currentWord = currentWord.toLowerCase();
            for (j = 0; j < currentWord.length; j++) {
                currentChar = currentWord[j];
                if (currentChar == "?") {
                    numQ++;
                    j++;
                    currentChar = currentWord[j];
                    for (k = 0; k < 5; k++) {
                        if (k != (j - numQ)) {
                            if (!retVal[k].includes(currentChar)) {
                                if (!locked.includes(k)) {
                                    retVal[k] += currentChar;
                                }
                            }
                        }
                        else if (retVal[k].includes(currentChar)) {
                            retVal[k].replace(currentChar, "");
                        }
                    }
                }
                else if (currentChar == "*")
                {
                    // todo: fix this
                }
                else {
                    retVal[j - numQ] = currentChar;
                    locked.push(j - numQ);
                }
            }
        }

        console.log(retVal);

        return retVal;
    }

    function EvaluateTokens() {

        var inputText = document.getElementById("input").value;
        AddWordToStream(inputText);
        results.push(inputText);

        var wildcards = GetWildcards();
        var alright = VALID_GUESSES;
        var maxScore = 0;
        var maxScoreWord = "";

        for (i = 0; i < alright.length; i++) {
            var score = 0;
            for (j = 0; j < 5; j++) {

                if (wildcards[j].length === 1 && alright[i][j] == wildcards[j][0]) {
                    score += 1;
                }
                else if (wildcards[j].length > 1 && wildcards[j].includes(alright[i][j])) {
                    score += 0.3;
                }
            }

            if (score > maxScore) {
                maxScore = score;
                maxScoreWord = alright[i];
            }
        }

        AddWordToStream(maxScoreWord);
    }
